import React from 'react'
import styled from 'styled-components'
import Slider from 'react-slick'
import { data } from '../mock/data'
import { Logo, Nav, NavButton } from '../styles/nav'
import { Page } from '../styles/Page'
import { MainBody } from '../styles/main'
import { Button } from '../styles/button'
import { FaPlus } from 'react-icons/fa'
import { sliderSettings } from '../styles/slider-config'

const Profile = () => {
    return (
        <Page>
            
            <Nav>
                <Logo>
                    Zumthor
                </Logo>
                
                <NavButton>
                    Sair
                </NavButton>                               
            </Nav>

            <MainBody>
                <ProfileSection>
                    <SectionHeader>
                        <SectionTitle>
                            ReferÃªncias de Projeto
                        </SectionTitle>
                        <AddButton>
                            <FaPlus />
                        </AddButton>
                    </SectionHeader>
                    
                        <ProjectSlider {...sliderSettings}>
                            {data.map(room => (
                                <div>
                                    <h3>3</h3>
                                </div>
                            ))}  
                        </ProjectSlider>                                              
                    
                    
                </ProfileSection>
                <ProfileSection>
                    oi
                </ProfileSection>
            </MainBody>

        </Page>
    )
}

export default Profile

const ProfileSection = styled.section`    
    min-height: 30vh;
    width: 100%;

    display: flex;
    align-items: center;
    
    flex-direction: column;
    margin: 15px 0;    
`
const SectionHeader = styled.div`
    width: 100%;   
    padding: 15px;

    display: flex;
    align-items: center;
    justify-content: space-between;
`
const SectionTitle = styled.h2`
    font-size: 16px;
`
const AddButton = styled(Button)`
    height: 45px;
    width: 45px;
`
const ProjectSlider = styled(Slider)`
    width: 100%;
`
const SectionBody = styled.div`    
    width: 100%;    
    padding: 15px;
    display: flex;
`
const SectionProject = styled.div`    
    width: 200px;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    margin-right: 15px;

    transition: 0.5s;

    cursor: pointer;

    &:hover {
        background: #ccc;
    }
`
const SectionImage = styled.img`
    height: 200px;
    object-fit: cover;
    width: 100%;
`
const SectionDescription = styled.div`    
    width: 100%;
    padding: 5px 7.5px;

    display: flex;
    align-items: center;
    justify-content: space-between;
`

